"use strict";(self.webpackChunkmy_app=self.webpackChunkmy_app||[]).push([[723],{723:e=>{e.exports=JSON.parse('{"email":"Stuur me een e-mail","cv":"Mijn CV","role":"Softwareontwikkelaar en Noorwegen-enthousiast","description":"Heisann! Ik ben een {age}-jarige Full Stack Softwareontwikkelaar, gespecialisseerd in front-end development. Ik heb een 4-jarige ICT {bachelorLink} gevolgd bij de Hogeschool Utrecht, Nederland. Ik heb {experience}+ jaar werkervaring, voornamelijk met React Javascript & Java Spring.","iam":"Ik ben","availability":"Beschikbaar voor freelance, werk op afstand of verhuizing naar Noorwegen.","norwaypart1":"Noorwegen is voor mij altijd meer geweest dan alleen een plek op de kaart. De adembenemende landschappen, de rijke geschiedenis en de mix van traditie en moderniteit hebben mij gefascineerd. Doordat ik vloeiend Noors spreek, heb ik mijn band met de cultuur verdiept, waardoor elke ervaring\u2014van het verkennen van de fjorden tot het omgaan met de warme gemeenschappen\u2014betekenisvoller is geworden.","norwaypart2":"Ik ben ge\xefnspireerd door de vriendelijkheid en duurzaamheid van Noorwegen en kijk reikhalzend uit naar de dag dat ik dit buitengewone land mijn thuis kan noemen.","skillstitle":"Mijn vaardigheden","skillsdescription":"Ontdek de softwarevaardigheden die ik heb om idee\xebn met eenvoud en precisie tot leven te brengen.","frontenddescription":"Ik hou ervan om nette, gebruiksvriendelijke websites te maken - vooral met React en JavaScript - waarbij ik me concentreer op ontwerpen die mensen graag gebruiken. Ik heb regelmatig contact met de klant om hun wensen te horen en krijg graag feedback op mijn werk, vooral als de klant erg tevreden is met mijn werk. Ik ben in staat om over te schakelen naar elk framework sinds ik er met een flink aantal heb gewerkt, en ik gebruik graag zowel Javascript als Typescript.","backenddescription":"Ik heb veel ervaring met het werken aan objectgeori\xebnteerde projecten, vooral met Java en Spring. Ik heb talloze verschillende applicaties gebouwd, deze door end-to-end (en unit) tests gehaald met JUnit5 en Mockito en ervoor gezorgd dat de hele applicatie bleef werken via een CI/CD-pipeline. Ik heb ook vaak met databases gewerkt zoals onder andere PostgreSQL en Hibernate, en heb deze aan een Java-applicatie gekoppeld en ze feilloos laten samenwerken.","toolstitle":"Tools & Platformen","toolsdescription":"Omdat ik Git veel heb gebruikt voor versiebeheer en GitHub voor (onder andere) pipelines, projectopslag en scrumboards, kan ik erg goed overweg met deze tools. Ik heb Postman gebruikt om de API\'s te testen die ik heb gemaakt / waarmee ik heb gewerkt en kan de command line gebruiken om met Git te werken / applicaties te deployen op bijv. Azure DevOps. Ik weet ook hoe ik met verschillende IDE\'s moet werken, waarbij Visual Studio Code mijn favoriet is.","worktitle":"Mijn projecten","workdescription":"Bekijk alle producten die ik heb gemaakt voor schoolprojecten, stages, bijprojecten en klussen.","luftandescription":"Luftan is een Zweeds bedrijf gespecialiseerd in geurverspreiders en Scandinavisch ge\xefnspireerde geuren. Het project omvat een volledig e-commerceplatform waar gebruikers door producten kunnen bladeren, items aan hun winkelwagentje kunnen toevoegen en bestellingen kunnen plaatsen. Ik heb de hele site vanaf nul ontwikkeld, waarbij zowel de front-end als de back-end ontwikkeling aan bod kwam.","candidateportaldescription":"Mysolution is een internationaal bedrijf dat een Salesforce-applicatie aanbiedt voor recruitmentbureaus. Tijdens mijn stage voor mijn HBO Bachelor IT Software Development studie moest ik voor een klant van Mysolution een onboarding portal cre\xebren, zodat de medewerkers van genoemde klant hun inloggegevens (personalia, bankrekeninggegevens, privacyverklaringen etc.) konden invullen. Ook moest ik onderzoek doen naar hoe om te gaan met gevoelige gebruikersgegevens volgens de EU-wetgeving (AVG) en gebruikers om toestemming vragen om hun gegevens op te slaan.","huskelistedescription":"HuskeListe is een eenvoudige Noorse taken-app waarmee gebruikers taken aan hun lijsten kunnen toevoegen, afstrepen en verwijderen, zodat ze georganiseerd blijven.","smartfinancedescription":"SmartFinance is een webapplicatie voor studenten Bedrijfskunde van Hogeschool Utrecht. Het helpt hen bij het oefenen met het maken van jaarrekeningen en geeft directe feedback ter voorbereiding op toetsen en huiswerk.","kpndescription":"KPN Reisbewegingen is een site waar KPN-medewerkers hun reisgegevens kunnen loggen, die vervolgens worden samengevoegd in een Excel-rapport. Managers kunnen afdelingsstatistieken bekijken en een scorebord stimuleert het verminderen van de CO2-uitstoot.","seeproject":"Bekijk project"}')}}]);